import React from "react";
import {Container} from "./style";

export default function Box(){
    return(
        <Container>

        <h2>Conheça o Projeto</h2>
        <h3>Aqui no Projeto Visão Social acreditamos na educação como ferramenta de transformação, diariamente atendemos 130 crianças de Sobradinho 2 -DF com atividades que reforçam o aprendizado e orientam para o mercado de trabalho.</h3>

        </Container>
      

    )
};
